### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Functions and Their Properties**
- **Function Composition**: Understanding how to compose functions and determine their domains.
  - Example: \( f \circ g \), \( g \circ f \)
- **Domain and Range**: Determining the domain and range of functions and their compositions.
  - Example: Domain of \( f \circ g \), \( g \circ f \)
- **One-to-One Functions**: Identifying if a function is one-to-one (injective).
  - Example: \( f(x) = |\log_2(x+1)| \)

#### 2. **Differentiability and Continuity**
- **Differentiability**: Understanding the conditions for a function to be differentiable.
  - Example: Differentiability of \( f(x) = \frac{\sin(x)}{x} \) at \( x = 0 \)
- **Continuity**: Ensuring a function is continuous across its domain.
  - Example: Continuity of piecewise functions.

#### 3. **Polynomials and Their Derivatives**
- **Polynomial Derivatives**: Calculating the derivative of a polynomial.
  - Example: Derivative of \( f(x) = a_5 x^5 + a_4 x^4 + a_3 x^3 + a_2 x^2 + a_1 x + a_0 \)
- **Evaluating Derivatives**: Evaluating derivatives at specific points.
  - Example: \( f'(0) \), \( f'(1) \), \( f'(-1) \)

#### 4. **Logarithmic and Exponential Functions**
- **Logarithmic Identities**: Using logarithmic identities to solve equations.
  - Example: Solving \( m^{\log_3 2} + 2^{\log_3 m} = 8 \)
- **Exponential Functions**: Understanding the behavior of exponential functions.
  - Example: Limits involving \( e^{2n} \), \( e^{3n} \)

#### 5. **Limits and Sequences**
- **Limits of Sequences**: Calculating the limit of sequences as \( n \to \infty \).
  - Example: \( \lim_{n \to \infty} \frac{n^5 - 3n^3 + \sin(n)}{2n^5 + \ln(n) + n^2} \)
  - Example: \( \lim_{n \to \infty} \frac{e^{2n} + n^4}{e^{3n} + n^5} \)

#### 6. **Piecewise Functions**
- **Piecewise Function Analysis**: Analyzing piecewise functions for continuity and differentiability.
  - Example: \( f(x) = \begin{cases}
Ax - B & \text{if } x \leq -1 \\
2x^2 + 3Ax + B & \text{if } -1 < x \leq 1 \\
4 & \text{if } x > 1
\end{cases} \)

### Equations

#### 1. **Function Composition**
- \( f \circ g (x) = f(g(x)) \)
- \( g \circ f (x) = g(f(x)) \)

#### 2. **Differentiability**
- \( f'(x) = \lim_{h \to 0} \frac{f(x+h) - f(x)}{h} \)
- For \( f(x) = \frac{\sin(x)}{x} \), \( f'(0) = 0 \)

#### 3. **Polynomial Derivatives**
- \( f(x) = a_5 x^5 + a_4 x^4 + a_3 x^3 + a_2 x^2 + a_1 x + a_0 \)
- \( f'(x) = 5a_5 x^4 + 4a_4 x^3 + 3a_3 x^2 + 2a_2 x + a_1 \)

#### 4. **Logarithmic Identities**
- \( m^{\log_3 2} + 2^{\log_3 m} = 8 \)
- Solution: \( m = 9 \)

#### 5. **Limits of Sequences**
- \( \lim_{n \to \infty} \frac{n^5 - 3n^3 + \sin(n)}{2n^5 + \ln(n) + n^2} = \frac{1}{2} \)
- \( \lim_{n \to \infty} \frac{e^{2n} + n^4}{e^{3n} + n^5} = 0 \)

#### 6. **Piecewise Functions**
- Continuity conditions for piecewise functions.
- Example: \( f(x) \) is continuous for all \( x \in \mathbb{R} \), then \( 6(A + B) = 3 \)

